import { Text, View } from 'react-native'
import React, { Component } from 'react'

export default class Umesh extends Component {
  render() {
    return (
      <View>
        <Text>umesh</Text>
        <TextInput
        style={styles.input}
        onChangeText={onChangeNumber}
        value={number}
        placeholder="useless placeholder"
        keyboardType="numeric"
      />
      </View>
    )
  }
}
